 @callerifodao  Meu Deus, meus olhos estão ardendo de desinformação:

-1: A France Football organizava o mundial até 2005

-2: Não estou falando da Libertadores, naquela época a France Football tinha feito uma parceria com a FIFA para elaborar o Mundial, na qual eles escolheram o clubes que mais ganharam em títulos e em números por cada continente.

