 @julioreis01  
Que mentira cara tu disse que o Rafinha só encosta! Pelo amor de Deus observa o movimento do braço esquerdo do Rafinha antes de chorar nos comentários, nitidamente ele faz força pra deslocar o Wesley que driblou ele.
E o Wesley não se jogou ele sentiu um empurrão e foi deslocado, pênalti legítimo!

 @julioreis01  
O VAR só aciona o árbitro principal pra contrariar a decisão dele em campo ou quando o árbitro em campo apitou na intuição, mas não tem certeza e solicita o uso do replay.
Na cabine do VAR eles devem ter falado: Rafinha usa o braço esquerdo com força pra deslocar o Wesley. Típico lance quando o jogador A desarma o jogador B na força pra depois desarmar a bola depois que o jogador B é derrubado, deslocado, empurrado ou desarmado no contato faltoso.

 @julioreis01  
Gol do Calleri legítimo aonde se ele usa os braços pra se apoiar nas costas do Fágner?!
Todo contato, mesmo sendo leve, nas costas do jogador é falta, isso é unânime!

 @julioreis01  
Para rapaz tu tá desesperado pra arranjar qualquer desculpa e choro como explicação e consolação do pq o São Paulo não quebrou o tabu! 
